"""## **Adding a component to a blank pipeline**"""

source_nlp = spacy.load("en_core_web_sm") #first load the pretrained pipeline from selected language

nlp = spacy.blank("en") #create blank pipeline
nlp.add_pipe("ner", source=source_nlp) #add ner component
nlp.pipe_names #check components

doc = nlp("Tesla Inc is going to acquire twitter for $45 billion")

for ent in doc.ents:
        print(ent.text, " | ", ent.label_, " | ", spacy.explain(ent.label_))

